var title_f16_50_17185="Circadian pattern AMI SCD";
var content_f16_50_17185=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F56626%7ECARD%2F59140&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F56626%7ECARD%2F59140&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 509px\">",
"   <div class=\"ttl\">",
"    Circadian pattern of nonfatal myocardial infarction and sudden death",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 489px; height: 526px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A meta-analysis was performed using trials that reported the timing for an acute myocardial infarction (N=66,635 patients) and sudden death (N=19,390 patients). An excess number of infarctions and sudden deaths occurred in the morning between the hours of 6 am and 12 pm, indicating a circadian pattern to their occurrence.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Kangro, T, Henriksen, E, Jonason, T, et al. Am J Cardiol 1997; 79:1507.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 557px\">",
"   <div class=\"ttl\">",
"    Circadian variation in unstable angina and non-Q wave myocardial infarction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 297px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Prospective analysis of patients entered into the TIMI III registry shows that there is a circadian variation in the onset of pain in patients with unstable angina and non-Q wave myocardial infarction (AMI); the greatest number of patients experience the onset of pain between 6 am and 12 pm.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Cannon, CP, McCabe, CH, Stone, PH, et al, for the TIMI III Registry and TIMI IIIB Investigators, AM J Cardiol 1997; 79:253.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
